import React,{Component} from 'react';
import './App.css';
import Pokecard from '../components/Pokecard/Pokecard';

export default class App extends Component {
  render(){
  const pokecards = [1,2,3,4,5,6,7,8,9,]
  pokecards.map(i=>{
    if(i.len==1){i="00"+i}
    if(i.len==2){i="0"+i}
  })  

  console.log(pokecards)


  return (
    <div className="App">
      {pokecards.map(i=> <Pokecard id={i}/>
      )}

    </div>
  );}
}

